import styled from "styled-components";

export const Input = styled.input`
  margin-top: 20px;
  background: none;
  border: none;
  outline: none;
  border-bottom: 1px solid #fff;
  padding-bottom: 5px;
`;

export const Email = styled.input`
  margin-top: 20px;
  background: none;
  border: none;
  outline: none;
  border-bottom: 1px solid #fff;
  padding-bottom: 5px;
`;

export const Label = styled.label`
  display: block;
`;
